/*[PATH @digikala/supernova-digikala-desktop/static/landings/digiplus/js/init.js]*/
IndexAction = {
    init: function () {
        this.initTab();
        this.initSlideNav();
        this.initLoadTab();
        this.initLogoAnimation();
        this.initSwiper();

        this.setGADigiplusSubscription();
        if(isModuleActive('plus_landing_banner_slider')) {
            this.initBannerSwiper();
            this.setDigiplusSubscriptionUTM();
        }
    },
    initLoadTab: function () {
        var $this = this;
        $(window).on('scroll', function() {
            var hT = $('#landing-tabs-section').offset().top,
                hH = $('#landing-tabs-section').outerHeight(),
                wH = $(window).height(),
                wS = $(this).scrollTop();
            if ((wS > (hT+hH-wH)) && !$this.scrolledToTab){
                $('.js-change-tab[data-tab="1"]').trigger('click');
                $this.scrolledToTab = true;
            }
        });
    },
    initTab: function () {
        var $this = this;
        $('.js-change-tab').on('click', function(e){
            e.preventDefault();
            
            var dataTab = $(this).data("tab");
            var $current, $next, $prev;

            $current = dataTab;
            $next = $current + 1;
            $prev = $current - 1;
            
            $('.c-digiplus-landing-tab__item').removeClass('c-digiplus-landing-tab__item--active');
            $('.c-digiplus-landing-tab__item[data-tab="'+ dataTab +'"]').addClass('c-digiplus-landing-tab__item--active');
            $('.c-digiplus-landing-tab__content').removeClass('c-digiplus-landing-tab__content--active');
            $('.c-digiplus-landing-tab__content[data-tab="'+ dataTab +'"]').addClass('c-digiplus-landing-tab__content--active');
            $('.js-lottie').empty();

            var lottieContainer = document.querySelector('.js-lottie[data-tab="'+ dataTab +'"]');

            $this.initLottie(animation[dataTab - 1], lottieContainer);
            $this.initChangeTab($prev, $current, $next);

        });


    },
    initSlideNav: function () {
        var $this = this;

        $('.js-nav-btn').on('click', function(e){
            e.preventDefault();

            var $current, $next, $prev;

            if($(this).hasClass('js-next-btn')) {
                $current = $('.js-current').data('tab') + 1;
            } else {
                $current = $('.js-current').data('tab') - 1;
            }

            $next = $current + 1;
            $prev = $current - 1;

            $this.initChangeTab($prev, $current, $next);
            $('.js-change-tab[data-tab="'+ $current +'"]').trigger('click');
        });
    },
    initChangeTab: function ($prev, $current, $next) {
        var tabCount = $('.js-change-tab').length;

        if(($prev != -1) && ($next != tabCount + 2)) {
            $('.js-nav-btn').removeClass('c-digiplus-landing-tab__slider-nav--deactive');
            $('.js-current, .js-next, .js-prev').removeClass('js-prev js-current js-next');
            $('.c-digiplus-landing-tab__content[data-tab="'+ $current +'"]').addClass('js-current');
            $('.c-digiplus-landing-tab__content[data-tab="'+ $prev +'"]').addClass('js-prev');
            $('.c-digiplus-landing-tab__content[data-tab="'+ $next +'"]').addClass('js-next');
        }

        if ($current == 1) {
            $('.js-prev-btn').addClass('c-digiplus-landing-tab__slider-nav--deactive');
        }

        if ($current == tabCount) {
            $('.js-next-btn').addClass('c-digiplus-landing-tab__slider-nav--deactive');
        }
    },
    initLottie: function (animation, container) {
        var params = {
            container: container,
            renderer: 'svg',
            loop: false,
            autoplay: true,
            animationData: animation
        };

        var anim;

        anim = lottie.loadAnimation(params);
    },
    initLogoAnimation: function() {
        var $self = this;
        var lottieContainer = document.querySelector('.js-logo-animation');

        setTimeout(function(){
            $self.initLottie(logoAnimation, lottieContainer);
            setTimeout(function() {
                $('.c-digiplus-landing-header__alpha-test').addClass('c-digiplus-landing-header__alpha-test--show');
            }, 3500);
        }, 500);
    },
    initSwiper: function(){
        new window.Swiper(
            ".js-swiper-videos",
            {
                slidesPerView: 1,
                slidesPerGroup: 1,
                lazy: {
                    enabled: true
                },
                pagination: {
                    el: '.swiper-pagination',
                    type: 'bullets',
                    clickable: true
                },
                navigation: {
                    nextEl: ".swiper-button-next",
                    prevEl: ".swiper-button-prev"
                }
            }
        );
    },
    initBannerSwiper: function () {
        var bannerCount = $('.js-swiper-banners').data('banner-count');
        if (bannerCount == 1) {
            new window.Swiper(
                ".js-swiper-banners",
                {
                    slidesPerView: 1,
                    slidesPerGroup: 1,
                    loop: false,
                    lazy: {
                        enabled: true
                    },
                    navigation: {
                        nextEl: ".swiper-button-next",
                        prevEl: ".swiper-button-prev"
                    }
                }
            );
        } else {
            new window.Swiper(
                ".js-swiper-banners",
                {
                    slidesPerView: 1,
                    slidesPerGroup: 1,
                    loop: true,
                    autoplay: {
                        delay: 7000,
                        disableOnInteraction: false,
                    },
                    lazy: {
                        enabled: true
                    },
                    navigation: {
                        nextEl: ".swiper-button-next",
                        prevEl: ".swiper-button-prev"
                    }
                }
            );
        }
    },
    isInViewport: function elementInViewport2(el) {
        var top = el.offsetTop;
        var left = el.offsetLeft;
        var width = el.offsetWidth;
        var height = el.offsetHeight;

        while(el.offsetParent) {
            el = el.offsetParent;
            top += el.offsetTop;
            left += el.offsetLeft;
        }

        return (
            top < (window.pageYOffset + window.innerHeight) &&
            left < (window.pageXOffset + window.innerWidth) &&
            (top + height) > window.pageYOffset &&
            (left + width) > window.pageXOffset
        );
    },
    setGADigiplusSubscription: function () {
        $('.js-ga-digiplus-subscription').on('click' , function () {
            var type = $(this).data('plan-type');
            try {
                ga('set', 'nonInteraction', true);
                ga('send', 'event', {
                    eventCategory: 'Plus Subscription',
                    eventAction:'Click',
                    eventLabel: type
                });
            } catch (e) {
                console.log('GA Error:' , e)
            }
        })
    },
    setDigiplusSubscriptionUTM: function () {
        var UTM = '?utm_source=pluslanding&utm_medium=slider&utm_campaignYalda#digiplus_register';
        $('.js-digiplus-banner-item').on('click' , function (e) {
            e.preventDefault();
            window.location.href = UTM
        })
    },
    scrolledToTab: false
};
$(function () {
    IndexAction.init();
});